INSERT INTO `book` VALUES ('2024-07-22','author','description','001','publisher','thumbnail','title'),('2024-07-22','author','description','002','publisher','thumbnail','title'),('2023-09-25','은하수미디어 편집부','▶ 《짱구는 못말려 스티커 컬러링북》 신간 소개\n스티커를 붙이며 집중력 Up! 성취감 Up!\n스티커 컬러링으로 만나는 짱구와 친구들! 10종의 모자이크 스티커로 나만의 작품을 완성...','8809255213775','은하수미디어','https://shopping-phinf.pstatic.net/main_4291235/42912353620.20230928092008.jpg','짱구는 못말려 스티커 컬러링북'),('2022-12-06','우스이 요시토','말썽꾸러기 짱구와 가족들의 요절복통 소동이 펼쳐집니다!\n미워할 수 없는 매력의 소유자 다섯 살 짱구와 가족들의 시끌벅적 유쾌한 명랑스토리.\n\n우스이 요시토의 만화 〈크레용 신짱〉의...','8809529012721','북엔','https://shopping-phinf.pstatic.net/main_3640611/36406116620.20221213164433.jpg','짱구는 못말려 아트포스터북'),('2023-11-30','북엔 편집부','천방지축 어리둥절 빙글빙글 돌아가는 짱구의 하루!\n짱구와 함께 하루에 하나씩 나를 찾아가는 2024년 일력!\n〈2024년 짱구는 못말려 일력〉\n\n짱구와 함께라면 뭐든지 할 수 있어...','8809529015326','북엔','https://shopping-phinf.pstatic.net/main_4369356/43693566620.20231101093609.jpg','짱구는 못말려 일력(2024)'),('2019-01-20','아이누리 편집부','예쁜 누나와 초코비를 좋아하는 5살 짱구와 살인적인 발 냄새를 가진\n아버지 그리고 세일과 미남을 좋아하는 엄마, 귀여운 여동생 짱아와 강아지\n흰둥이와 함께 행복한 나날을 보내고 있...','8809617952960','아이누리','https://shopping-phinf.pstatic.net/main_3244520/32445209858.20221019105807.jpg','짱구는 못말려 네일스티커'),('2024-07-05','고재현','명탐정이 꿈인 초등학생 지안과 도하. 맞은편 건물에 사는 둘은 공통점이 있었으니, 바로 서로의 집이 301호라는 사실!\n\n301호 명탐정들은 서로의 파트너가 되어 동네의 안전을 책...','9788901281254','웅진주니어','https://shopping-phinf.pstatic.net/main_4891628/48916285621.20240706071140.jpg','301호 명탐정'),('2011-04-20','송도수','게임 를 만화로 만나요!\n\n게임 를 옮긴 『코믹 메이플 스토리 오프라인 RPG』 제45권. 게임 를 만화로 옮겼다. \'오락\'과 \'교육\'이 어우러져 아이들의 긍정적인 가치관 함양에 ...','9788926391457','서울문화사','https://shopping-phinf.pstatic.net/main_3249755/32497559760.20230801121457.jpg','메이플 스토리 오프라인 RPG 45'),('2022-11-10','최예신^박진원^이경숙^김주현','1. 2021년 제2, 3회 빅데이터분석기사 실기 기출복원문제 수록\n2021년 시행된 제2, 3회 빅데이터분석기사 실기시험 문항 완벽 복원\n2. 챕터별 중요 출제 포인트가 한눈에 ...','9788927444756','예문사','https://shopping-phinf.pstatic.net/main_3244498/32444989103.20230328162342.jpg','2022 빅데이터분석기사 실기 한권완성 필답형+작업형 (2021년 제2, 3회 기출복원문제